<script>
import FullVersion from "@/components/FullVersion";
import {gsap} from "gsap";
import {TextPlugin} from "gsap/TextPlugin";
import {Draggable} from "gsap/all"

export default {
  name: "Hero",
  components: {FullVersion},

  data() {
    return {
      show: false,
    }
  },
  mounted() {
    gsap.registerPlugin(TextPlugin);
    gsap.registerPlugin(Draggable)

    const master = gsap.timeline();

    const tl = gsap.timeline()

    tl.to("#intro-text", {text: "Hi,I'm Melvin", duration: 1, delay: 1, ease: "linear"});
    tl.to("#desc-text", {text: "Crazy about tech", duration: 1, delay: 1, ease: "power1.easeInOut"});
    tl.to("#desc-text", {text: "Fullstack Developer", duration: 1, delay: 1, ease: "power1.easeInOut"});
    tl.from("#portfolio", {y: 40})
    tl.call(() => {
      this.show = true
    })

    const cogTimeline = gsap.timeline()
    cogTimeline.to("#cog-one", {
      rotation: 360, duration: 2, transformOrigin: 'center', ease: 'linear', repeat: -1,
    })
    cogTimeline.to("#cog-two", {
      rotation: 360, duration: 3, transformOrigin: 'center', ease: 'linear', repeat: -1,
    })
    cogTimeline.to("#cog-three", {
      rotation: 360, duration: 2, transformOrigin: 'center', ease: 'linear', repeat: -1,
    })
    cogTimeline.to("#cog-four", {
      rotation: 360, duration: 3, transformOrigin: 'center', ease: 'linear', repeat: -1,
    })
    cogTimeline.to("#cog-five", {
      rotation: 360, duration: 2, transformOrigin: 'center', ease: 'linear', repeat: -1,
    })
    cogTimeline.to("#cog-six", {
      rotation: 360, duration: 3, transformOrigin: 'center', ease: 'linear', repeat: -1,
    })
    cogTimeline.to("#main-cog", {
      rotation: 360, duration: 6, transformOrigin: 'center', ease: 'linear', repeat: -1,
    })

    const rays = gsap.utils.toArray('.icons');

    const iconsTimeline = gsap.timeline({
      onComplete: function () {
        rays.forEach(function (ray, i) {


          const action = gsap.to(ray, {
            scale: 'random(0.95, 1)',
            rotation: '+=' + 'random(-3, 3)',
            duration: "random(0.5, 1)", // NO refresh!
            ease: 'random(bounce, power2, power1.inOut)',
            repeat: -1, yoyo: true, repeatRefresh: true
          });

          ray.addEventListener("mouseenter", function () {
            action.pause();
            gsap.to(ray, {scale: 1.2, x: 4, transformOrigin: 'center'})

          });

          ray.addEventListener("mouseleave", function () {
            action.play();
            gsap.to(ray, {x: 4, rotate: 10})
          })
        })
      }
    })

    iconsTimeline.from(rays, {
      opacity: 0,
      y: 16,
      duration: 4,
      ease: 'elastic'
    })
    iconsTimeline.to(rays, {
      duration: function (i, target, list) {
        return 0.5 + (i * 0.1)
      },
      ease: 'none',
      transformOrigin: 'left center',
      stagger: -0.3
    })



    master.add(tl)
    master.add(iconsTimeline)
    master.add(cogTimeline)


  }
}
</script>

